message_history.content:
B_x = \frac{\mu_0}{4\pi} \frac{3Mzx}{r^5}
B_y = \frac{\mu_0}{4\pi} \frac{3Mzy}{r^5}
B_z = \frac{\mu_0}{4\pi} \frac{M(3z^2 - r^2)}{r^5}
